import axios from "axios";

const API_URL = "http://localhost:8000/api/posts/";

const getPosts = async () => {
  try {
    const response = await axios.get(API_URL);
    return response.data;
  } catch (err) {
    console.log(err);
  }
};

const PostsService = {
  getPosts,
};

export default PostsService;
